import React from "react";
import styled from "styled-components";
import landing from "../illustration.jpg";

const Main = styled.div`
  display: flex;
  flex-direction: row;
  width: 100%;
  height: 100%;
  align-items: center;
  margin: 0;
  padding: 0;
`;

const LeftContainer = styled.div`
  background: white;
  height: 100%;
  width: 50%;
  display: flex;
  flex-direction: column;
  padding-top: 70px;
  padding-left: 50px;
`;

const RightContainer = styled.div`
  height: 100%;
  width: 50%;
  background: url(${landing});
  background-position: 0px -50px;
  background-size: cover;
`;

const LoginText = styled.h1`
  font-family: "Poppins";
  font-weight: 700;
  font-size: 28px;
  color: black;
`;

const Text2 = styled.h6`
  font-family: "Quicksand";
  font-weight: 700;
  font-size: 12px;
  color: #989898;
  margin-top: 4px;
`;

const SignInWithGoogle = styled.div`
  width: 40%;
  height: 40px;
  border: 1px solid #d3d3d3;
  border-radius: 12px;
  margin-top: 20px;
`;

const BackgroundFilter = styled.div`
  height: 100%;
  width: 100%;
  background-color: rgba(38, 70, 83, 0.7);
  display: flex;
`;

function SignupPage() {
  return (
    <Main>
      <LeftContainer>
        <LoginText>Login</LoginText>
        <Text2>Login to upload your notes on cloud!</Text2>
        <SignInWithGoogle></SignInWithGoogle>
      </LeftContainer>
      <RightContainer />
    </Main>
  );
}

export default SignupPage;
